INSERT INTO `v1_4cc6d812ffa173dc04129070b3c2ae3ed7dc0d83d35bba76c1711aa20e211cc1` VALUES (11, "マヒルさん、どうしました……？\nもしかして、誕生日ケーキに\n変なところでも……？", 0.5, 10, 0, 103811, 38214, 0, 1, 38214070, 1);
